●汗に近いミネラルバランスなので、「水分」と「塩分」を簡単に補給できます。<BR>●すっきり爽やかなレモン味でカロリーもゼロ。<BR>●クエン酸１０００ｍｇ配合<BR>●「かくれ脱水」「冬脱水」などにもミネラルバランスの良い水分補給はおススメです。<BR>●塩は「天塩」を使用しています。<br>●タイプ／ペット<BR>●１ケース＝５００ｍｌ×２４本入<BR>※メーカー都合により、パッケージデザインおよび仕様が変更になる場合がございます。<BR>※賞味期限について：商品の発送時点で、賞味期限まで残り120日以上の商品をお届けします。<br>●メーカー／赤穂化成<br>●型番／INR5687893<br>●JANコード／4901291990758<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

