■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>水分と電解質のすばやい補給に。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5329/1021119-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">◆使用上の注意◆<br>※本品は電解質の摂取を目的にしているため、通常の飲料に比べ、ナトリウム等の電解質濃度が高くなっています。塩分の摂取制限をされている方や腎疾患の方等は飲用をお控えください。<br>※乳児・幼児や下痢、嘔吐が激しいときの飲用は医師などの専門家にご相談ください。<br>※多量摂取により疾病が治癒したり、より健康が増進するものではありません。<br>※本品は吸湿しやすいので、開封後はすぐにご使用ください。<br>※パウダーが変色することがありますが、品質に問題ありません。<br>※本品を溶かしたり保存する場合、金属以外の容器をご使用ください。<br>※高温、湿気、光を避けて保存してください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="400" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5329/1021119-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="715" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5329/1021119-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="817" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5329/1021119-04.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="742" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5329/1021119-05.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">電解質(ナトリウム)とブドウ糖を一緒に摂ることで水分吸収が促進され、渇いた身体に効率よく水分が浸透します。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">1包(6g)あたり:エネルギー19.2kcal、たんぱく質0g、脂質0g、炭水化物4.8g、ナトリウム345mg、カリウム157.3mg、マグネシウム4.8mg、カルシウム9.6mg<br>食塩相当量0.88g</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">ブドウ糖、マルトデキストリン、食塩、海塩、クエン酸ナトリウム、塩化カリウム、酸味料、香料、乳酸カルシウム、クエン酸、ビタミンC、硫酸マグネシウム、甘味料(ステビア)、ナイアシン、ビタミンB2、ビタミンB1、ビタミンB6(原材料の一部に乳を含む)</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--アレルギー表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr><td align="center" bgcolor="#FFFFCC" colspan="7"><font color="#333333" size="-1">アレルギー表示（原材料の一部に以下を含んでいます）</font></td></tr><tr><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">卵</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">乳</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">小麦</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">そば</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">落花生</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">えび</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">かに</font></td></tr><tr bgcolor="#FFFFFF"><td width="10%" align="center"><font color="#333333" size="-1"></font></td><td width="10%" align="center"><font color="#333333" size="-1">●</font></td><td width="10%" align="center"><font color="#333333" size="-1"></font></td><td width="10%" align="center"><font color="#333333" size="-1"></font></td><td width="10%" align="center"><font color="#333333" size="-1"></font></td><td width="10%" align="center"><font color="#333333" size="-1"></font></td><td width="10%" align="center"><font color="#333333" size="-1"></font></td></tr></table><br><!--アレルギー表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">電解質(ナトリウム)とブドウ糖を一緒に摂ることで水分吸収が促進され、渇いた身体に効率よく水分が浸透します。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">1包6g×50包</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：13×8×15cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：390g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">スティックタイプ<br>柑橘系風味(無果汁)</font><br><font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
